import './style.css'
import React, { useState, useEffect } from 'react'
import Nav from '../Navbar'
import Card from '../Card'
import Form from '../Form'
import { Spinner } from 'reactstrap'

const url = 'https://google-maps-search1.p.rapidapi.com/search';

const options = {
  method: 'POST',
  headers: {
    'content-type': 'application/json',
    'X-RapidAPI-Host': 'google-maps-search1.p.rapidapi.com',
    'X-RapidAPI-Key': '2c027e32bdmshb9b7054156db181p103862jsnd0754bde8547'
  },
  body: '{"limit":3,"language":"en","region":"au","queries":["top rated speech therapist turramurra, NSW, AU"],"coordinates":"37.381315,-122.046148"}'
};

//.then(json => console.log(json.response.places[0]))
// .then((response) => {
//   console.log("App-data", res)})

const App = () => {

  const [result, setResult] = useState();

  useEffect(() => {
    // const makeAPICall = async () => {
    // await fetch(url, options)
    //     .then((res) => await res.json())
    //     .then((data) => { setResult(data.response.places[0]) 
    //     console.log("App-data", result)});
    // }
    //     makeAPICall();

    async function makeAPICall() {
      const response = await fetch(url,options)
        
      
      const data = await response.json();
      setResult(data.response.places[0]) 
      console.log("App-data", data);
    
    }
    makeAPICall();
  },[]);
  if (!result) {
    return (<div>
      <Spinner
        color="primary"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="secondary"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="success"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="danger"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="warning"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="info"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="light"
        type="grow"
      >
        Loading...
      </Spinner>
      <Spinner
        color="dark"
        type="grow"
      >
        Loading...
      </Spinner>
    </div>)
  }  
  return (
    <div className="App">
      <Nav />
      <Form />
      <Card {...result} />
    </div>

  );
}

export default App;
